cy.fixture("users.json").then(function (users) {
    var u = users.staff;
    // 1. Get token via request (fast)
    cy.request({
        method: "POST",
        url: "".concat(Cypress.env("API_BASE_URL"), "/v1/auth/login"),
        body: { email: u.email, password: u.password }
    }).then(function (resp) {
        var token = resp.body.token;
        // 2. Verify Profile contract
        cy.request({
            method: "GET",
            url: "".concat(Cypress.env("API_BASE_URL"), "/v1/user/profile"),
            headers: { Authorization: "Bearer ".concat(token) }
        }).then(function (profileResp) {
            expect(profileResp.status).to.eq(200);
            expect(profileResp.body).to.have.property("email", u.email);
            expect(profileResp.body).to.have.any.keys("id", "role", "profile");
        });
    });
});

